import os
import json
from crypto.ecc_utils import ECC_encrypt
from crypto.aes_utils import AES_encrypt

# === 1. Define plaintext content to encrypt ===
plaintext = b"This is a secure document that should be stored in EHR."

# === 2. Generate AES session key (32 bytes for AES-256) ===
session_key = os.urandom(32)

# === 3. AES Encrypt the content ===
encrypted_file = AES_encrypt(plaintext, session_key)

# === 4. Build the minimal trapdoor ===
trapdoor = {
    "type": "insert",
    "searchable_roles": ["doctor"],
    "update_delete_roles": ["doctor"],
    "session_key": "f61bf5a2aebacb6bd71852672df84d2c5610baef2efb9f34977b2e357b462e59",
    "file": ""
}

# === 5. Load server ECC public key ===
with open("server_public_key.pem", "rb") as f:
    ECC_PUBLIC_KEY = f.read().decode()

# === 6. ECC Encrypt the trapdoor ===
trapdoor_bytes = json.dumps(trapdoor).encode()
encrypted_trapdoor = ECC_encrypt(trapdoor_bytes, ECC_PUBLIC_KEY)

# === 7. Save trapdoor to file ===
with open("trapdoor_insert.bin", "wb") as f:
    f.write(encrypted_trapdoor)

print("[Client] Encrypted INSERT trapdoor saved to trapdoor_insert.bin")
